    false,nt"url": null,nt"notes": "Terrapoint collected Light Detection and
    Ranging (LiDAR) data to complete the 2005 project for Yakima County. This project
    has partial coverage of Yakima County, totaling 4757 sq km in southern Washington.
    The Airborne LiDAR survey was conducted using Terrapoint's 40 kHz ALTMS (Airborne
    Laser Terrain Mapping System), flying at an optimum height of 3500 ft AGL at 140
    knots. The system consists of a 36-degree full angle laser, a Trimble 4700 GPS receiver
    and a Honeywell H764 IMU unit. This metadata is a collaboration of ancillary reports.",nt"license_title":
